import React, { Component } from "react";

class Home extends Component {
    render() {
        return (
            <div id="home">
                <svg viewBox="0 0 2025 600">
                    <text x="50%" y="50%" fill="transparent" textAnchor="middle">
                        Jérémy LY
                    </text>
                </svg>
                <div className="role">Développeur Web</div>
            </div>
        );
    }
}

export default Home;
